<h3 style={{float:'left' ,width:"30%" , margin: "0px"} }>Name*</h3><input type="text" className="name"></input>
<h3 style={{float:'left' ,width:"30%" , margin: "0px"}}>Email*</h3><input type='text' className="email3"></input>
<h3 style={{float:'left' ,width:"30%" , margin: "0px"}}>Password*</h3><input type='password' className="password3"></input>
